<!DOCTYPE html>
<html lang="ar" dir="rtl">
<head>
<meta charset="UTF-8">
<meta name="viewport" content="width=device-width, initial-scale=1.0">
<title>points show</title>
<link href="https://fonts.googleapis.com/css2?family=Tajawal:wght@400;700&display=swap" rel="stylesheet">
<style>
body {
  font-family: "Tajawal", sans-serif;
  margin: 0; padding: 0;
  background: linear-gradient(135deg, #74b9ff, #a29bfe, #ffeaa7, #fab1a0);
  background-size: 400% 400%;
  animation: gradientBG 15s ease infinite;
  display: flex; justify-content: center; align-items: center;
  height: 100vh; flex-direction: column;
  overflow: hidden;
}
@keyframes gradientBG {
  0%{background-position:0% 50%}
  50%{background-position:100% 50%}
  100%{background-position:0% 50%}
}
#welcome, #pointsPage {
  display: none;
  text-align: center;
  position: relative;
  z-index: 10; /* Ø¹Ù„Ø´Ø§Ù† ØªØ¨Ù‚Ù‰ ÙÙˆÙ‚ Ø´Ø®ØµÙŠØ© Ø²ÙŠØ²Ùˆ */
}
h1 { font-size: 2.4em; color: #2d3436; text-shadow: 2px 2px 5px rgba(0,0,0,0.1); margin-bottom: 20px; }
button {
  background: linear-gradient(45deg, #fd79a8, #e84393);
  color: white; border: none;
  padding: 14px 28px; border-radius: 12px; cursor: pointer;
  font-size: 1.2em; transition: transform 0.3s ease, box-shadow 0.3s ease;
}
button:hover {
  transform: scale(1.05);
  box-shadow: 0 6px 15px rgba(0,0,0,0.2);
}
.container {
  background: rgba(255,255,255,0.95);
  padding: 25px 20px;
  border-radius: 20px;
  box-shadow: 0 8px 20px rgba(0,0,0,0.25);
  width: 90%; max-width: 360px;
  box-sizing: border-box;
  z-index: 2;
  position: relative;
}
.container > * { margin-bottom: 16px; }
input {
  width: 100%; padding: 14px;
  border: 1px solid #ccc; border-radius: 12px;
  font-size: 1.1em;
  transition: border 0.3s ease, box-shadow 0.3s ease;
  box-sizing: border-box;
}
input:focus {
  border-color: #6c5ce7;
  box-shadow: 0 0 8px rgba(108,92,231,0.5);
  outline: none;
}
.suggestions {
  background: #fff; border-radius: 12px; border: 1px solid #ddd;
  max-height: 150px; overflow-y: auto;
}
.suggestions div {
  padding: 10px; cursor: pointer; transition: background 0.3s ease;
  font-size: 1em;
}
.suggestions div:hover { background: #dfe6e9; }
#result {
  background: #f1f2f6;
  padding: 14px;
  border-radius: 12px;
  box-shadow: 0 2px 8px rgba(0,0,0,0.1);
  font-size: 1.2em;
  color: #2d3436;
  transition: opacity 0.5s ease;
}

/* Ø´Ø®ØµÙŠØ© Ø²ÙŠØ²Ùˆ */
#zizo-container {
  position: fixed;
  bottom: 0;
  left: 50%;
  transform: translateX(-50%);
  width: 60vw;   /* Ø¨Ø¯Ù„ 20% Ù…Ù† Ø¹Ø±Ø¶ Ø§Ù„Ø´Ø§Ø´Ø© */
  height: 60vh;  /* Ø¨Ø¯Ù„ 20% Ù…Ù† Ø§Ø±ØªÙØ§Ø¹ Ø§Ù„Ø´Ø§Ø´Ø© */
  z-index: 1;
  pointer-events: none;
  opacity: 0.9;
}

/* ÙÙ‚Ø§Ø¹Ø§Øª */
.float-layer{position:fixed;inset:0;pointer-events:none;z-index:0}
.bubble{
  position:absolute; width:26px; height:26px; border-radius:50%;
  background:rgba(255,255,255,0.7);
  box-shadow:0 4px 10px rgba(0,0,0,0.1);
  animation: rise linear infinite;
}
@keyframes rise{
  0%{transform:translateY(110vh) scale(0.8); opacity:0}
  10%{opacity:1}
  100%{transform:translateY(-20vh) scale(1.2); opacity:0}
}

  path[fill="#fecb9c"] {
  animation: pulse 1s infinite;
}

@keyframes pulse {
  0% { transform: scale(1); }
  50% { transform: scale(1.05); }
  100% { transform: scale(1); }
}
  
</style>
</head>
